INSERT INTO `ca_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1, 1, '2021-03-09 10:46:10', '2021-03-09 02:46:10', '<!-- wp:paragraph -->\n<p>歡迎使用 WordPress。這是這個網站的第一篇文章，試試為這篇文章進行編輯或直接刪除，然後開始撰寫新文章！</p>\n<!-- /wp:paragraph -->', '網站第一篇文章', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2021-03-09 10:46:10', '2021-03-09 02:46:10', '', 0, 'http://cargo.com/?p=1', 0, 'post', '', 1),
(2, 1, '2021-03-09 10:46:10', '2021-03-09 02:46:10', '<!-- wp:paragraph -->\n<p>這是一個範例頁面。頁面與網站文章不同，因為它顯示的位置為固定位置，並且大多數的佈景主題會將它顯示在網站導覽選單中。大多數人會新增一個〈關於〉頁面，以便向網站訪客介紹自己。〈關於〉頁面的內容類似以下示範：</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>嗨，你好！白天我是一位郵差，晚上則是個滿懷抱負的演員，這是用來展現自我的網站。我住在高雄，養了一隻極通人性的狗叫小黑；最愛喝啤酒，目標是為市面上買的到的所有啤酒都寫一篇評論。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>或是像這樣：</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>XYZ Doohickey Comany 成立於 1971 年，公司成立以來，我們一直為大眾提供高品質的網站客製化服務。目前公司位於台北市，有超過 2,000 名員工，並持續為開源社群提供資源及場地。</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>身為一位新的 WordPress 使用者，請前往<a href=\"http://cargo.com/wp-admin/\">控制台</a>刪除這個頁面，並建立屬於自己的頁面。祝使用愉快！</p>\n<!-- /wp:paragraph -->', '範例頁面', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2021-03-09 10:46:10', '2021-03-09 02:46:10', '', 0, 'http://cargo.com/?page_id=2', 0, 'page', '', 0),
(3, 1, '2021-03-09 10:46:10', '2021-03-09 02:46:10', '<!-- wp:heading --><h2>我們是誰</h2><!-- /wp:heading --><!-- wp:paragraph --><p>我們的網站網址為 http://cargo.com。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>這個網站收集了哪些個人資訊，以及為什麼要收集這些資訊</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>留言</h3><!-- /wp:heading --><!-- wp:paragraph --><p>使用者在這個網站發佈留言後，我們會收集顯示於留言表單中的資料、使用者的來源 IP 位址及瀏覽器的使用者代理程式字串，以協助網站偵測垃圾留言。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>這個網站會根據使用者的電子郵件地址建立匿名化字串 (亦稱為<strong>雜湊值</strong>)，並提供給 Gravatar 個人頭像服務以查詢這個使用者是否為這項服務的使用者。如需瞭解 Gravatar 個人頭像服務的隱私權政策，請造訪 <a title=\"Automattic 的隱私權政策\" href=\"https://automattic.com/privacy/\" target=\"_blank\">https://automattic.com/privacy/</a>。網站管理員核准使用者發佈的留言後，使用者的個人資料圖片便會在留言內容中公開顯示。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>媒體</h3><!-- /wp:heading --><!-- wp:paragraph --><p>如需將圖片上傳至這個網站，請避免上傳內嵌 EXIF GPS 位置資料的圖片，因為其他使用者可以從網站上下載圖片並擷取當中的位置資料。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>聯絡表單</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookie</h3><!-- /wp:heading --><!-- wp:paragraph --><p>使用者在這個網站發佈留言時，可以選擇是否在 Cookie 中儲存使用者姓名、電子郵件地址及網站網址；儲存這些資料是為了使用者更加方便，以便讓使用者發佈其他留言時，無需再次填寫個人資料。在使用者不自行清除裝置 Cookie 的狀況下，這些 Cookie 在個人裝置上保留一年。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>如果使用者造訪這個網站的登入頁面，系統會設定一個臨時 Cookie 以確定使用者的瀏覽器是否接受 Cookie；這個 Cookie 不包含任何個人資料，並會在使用者關閉瀏覽器時捨棄。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>使用者登入網站後，系統會設定幾個 Cookie 以儲存使用者的登入資訊及顯示項目設定；登入資訊 Cookie 會保留兩天，顯示項目設定 Cookie 則會保留一年。如果登入時核取了 [保持登入] 這項設定，使用者的登入狀態會維持兩週；帳號登出後，便會移除使用者裝置上的登入資訊 Cookie。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>使用者編輯或發佈文章時，會在瀏覽器中儲存其他 Cookie。這個 Cookie 不包含任何個人資料，僅記錄表示使用者撰寫的文章的文章 ID，並會在一天後過期。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>來自第三方網站的嵌入內容</h3><!-- /wp:heading --><!-- wp:paragraph --><p>這個網站上的文章可能會嵌入視訊、圖片、文章等內容，而來自第三方網站的嵌入內容，其隱私權處理方式與使用者造訪這些網站時的規定完全相同。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>無論使用者是否有這些第三方網站的帳號或是否登入網站，他們都會以各種方式收集與使用者相關的資料，如 Cookie、嵌入第三方追蹤程式碼、監視使用者與嵌入內容的互動等。</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>使用者資料分析</h3><!-- /wp:heading --><!-- wp:heading --><h2>這個網站的個人資料分享對象</h2><!-- /wp:heading --><!-- wp:paragraph --><p>如果你提出密碼重設要求，你目前進行連線的 IP 位址會顯示於密碼重設電子郵件中。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>這個網站的個人資料保留期限</h2><!-- /wp:heading --><!-- wp:paragraph --><p>當使用者在這個網站發佈留言後，該則留言及其中繼資料將會無限期保留。這樣系統便可以自動辨識及核准任何後續留言，而不須將其保留在待審核的佇列中。</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>針對在這個網站上註冊的使用者，這個網站還會儲存他們在使用者 [個人資料] 頁面中提供的個人資訊。全部使用者都可以隨時查看、編輯或刪除自己的個人資訊 (無法變更的使用者名稱除外)。請注意，網站管理員也可以查看及編輯這些個人資訊。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>使用者對個人資料擁有哪些權利</h2><!-- /wp:heading --><!-- wp:paragraph --><p>如果使用者在這個網站擁有帳戶或曾發佈留言，便可以要求下載使用者在這個網站上的個人資料的資料匯出檔，這個檔案包含使用者提供給這個網站的全部個人資料。使用者也可以要求清除曾提供給這個網站的全部個人資料，但這項要求不包含站方為了管理、法律或安全目的而必須保留的相關資料。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>這個網站會將使用者資料傳送至何處</h2><!-- /wp:heading --><!-- wp:paragraph --><p>使用者留言資料會傳送至垃圾留言自動偵測服務進行檢查。</p><!-- /wp:paragraph --><!-- wp:heading --><h2>網站聯絡資訊</h2><!-- /wp:heading --><!-- wp:heading --><h2>其他資訊</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>這個網站保護個人資料的方式</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>這個網站會採取的個人資料外洩處理程序</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>這個網站會從第三方接收哪些個人資料</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>這個網站對使用者個人資料進行了哪些自動化決策或分析</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>監管行業揭露需求</h3><!-- /wp:heading -->', '隱私權政策', '', 'draft', 'closed', 'open', '', 'privacy-policy', '', '', '2021-03-09 10:46:10', '2021-03-09 02:46:10', '', 0, 'http://cargo.com/?page_id=3', 0, 'page', '', 0),
