INSERT INTO `ca_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`) VALUES
(1, 'wc-admin-manage-store-activity-from-home-screen', 'info', 'en_US', '新功能！ 在主畫面管理商店活動', '清楚掌握接下來需要針對訂單、產品和顧客意見採取的步驟。<br /><br />深入瞭解如何使用主畫面的活動面板。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-09 02:49:32', NULL, 0, 'plain', '', 0, 'info'),
(2, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', '註冊即可獲得祕訣、產品更新和啟發', '我們隨時在此為你服務 — 我們會將各項提示、產品更新以及靈感直接寄送到你的電子郵件信箱。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-09 02:49:33', NULL, 0, 'plain', '', 0, 'info'),
(3, 'wc-admin-marketing-intro', 'info', 'en_US', '與你的讀者聯繫', '利用專為 WooCommerce 打造的行銷工具來擴大顧客群、提升銷售量。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-09 02:49:33', NULL, 0, 'plain', '', 0, 'info'),
(4, 'wc-admin-wc-helper-connection', 'info', 'en_US', '連結至 WooCommerce.com', '連結以接收重要的產品通知和更新。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-09 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(5, 'facebook_pixel_api_2021', 'marketing', 'en_US', 'Improve the performance of your Facebook ads', 'Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved performance and measurement of your Facebook ad campaigns.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(6, 'facebook_ec_2021', 'marketing', 'en_US', 'Sync your product catalog with Facebook to help boost sales', 'A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(7, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(8, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(9, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(10, 'wc-admin-getting-started-in-ecommerce', 'info', 'en_US', 'Getting Started in eCommerce - webinar', 'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(11, 'your-first-product', 'info', 'en_US', 'Your first product', 'That\'s huge! You\'re well on your way to building a successful online store — now it’s time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(12, 'wc-square-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(13, 'wc-square-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with Square and Apple Pay ', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(14, 'wc-admin-optimizing-the-checkout-flow', 'info', 'en_US', 'Optimizing the checkout flow', 'It\'s crucial to get your store\'s checkout as smooth as possible to avoid losing sales. Let\'s take a look at how you can optimize the checkout experience for your shoppers.', '{}', 'pending', 'woocommerce.com', '2021-01-28 02:49:34', NULL, 0, 'plain', '', 0, 'info'),
(15, 'wc-admin-first-five-things-to-customize', 'info', 'en_US', 'The first 5 things to customize in your store', 'Deciding what to start with first is tricky. To help you properly prioritize, we\'ve put together this short list of the first few things you should customize in WooCommerce.', '{}', 'unactioned', 'woocommerce.com', '2021-02-22 21:18:49', NULL, 0, 'plain', '', 0, 'info'),
(16, 'wc-admin-effortless-payments-by-mollie', 'info', 'en_US', 'Effortless payments by Mollie', 'Offer global and local payment methods, get onboarded in minutes and supported in your language – try it now!', '{}', 'pending', 'woocommerce.com', '2021-02-18 18:49:34', NULL, 0, 'plain', '', 0, 'info'),
(17, 'wc-admin-mobile-app', 'info', 'en_US', '安裝 Woo 行動應用程式', '只要安裝 WooCommerce　行動應用程式，不論身在何處皆可管理訂單、接收銷售通知及檢視關鍵指標。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-16 05:18:48', NULL, 0, 'plain', '', 0, 'info'),
(18, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', '透過使用方式追蹤功能協助改善 WooCommerce', '收集使用情況資料可以協助我們改善 WooCommerce。你的商店會是我們的參考依據，協助我們評估新功能、判斷更新項目的品質，或評判改善項目是否見效。你隨時可以造訪<a href=\"http://cargo.com/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">「設定」</a>，選擇停止分享資料<a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">閱讀更多內容</a>，瞭解我們會收集哪些資料。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-16 05:18:48', NULL, 0, 'plain', '', 0, 'info'),
(19, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', '開始在商店上接受付款！', '透過適合你的供應商收取付款 — WooCommerce 有超過 100 種付款途徑可供選擇。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-16 05:18:48', NULL, 0, 'plain', '', 0, 'info'),
(20, 'wc-admin-filter-by-product-variations-in-reports', 'info', 'en_US', '新功能 - 在訂單和產品報告中依商品款式篩選', '眾所期待的一項功能推出了！ 你現在可透過訂單和產品報告深入瞭解各商品款式。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-16 05:18:48', NULL, 0, 'banner', 'http://cargo.com/wp-content/plugins/woocommerce/packages/woocommerce-admin/images/admin_notes/filter-by-product-variations-note.svg', 0, 'info'),
(21, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', '想要選擇佈景主題嗎？', '瀏覽與 WooCommerce 相容的佈景主題，然後挑選符合品牌及商業需求的樣式。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-16 05:18:48', NULL, 0, 'plain', '', 0, 'info'),
(22, 'wc-admin-insight-first-product-and-payment', 'survey', 'en_US', '深入剖析', '超過 80% 的新商家會在首週新增第一項產品，並至少設定一種付款方式。 我們樂意提供協助，讓你生意興隆！ 這類洞察分析相當實用，對吧？', '{}', 'unactioned', 'woocommerce-admin', '2021-03-16 05:18:48', NULL, 0, 'plain', '', 0, 'info'),
(23, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', '你已受邀分享體驗', '既然你選擇與我們合作，我們的目標是確保提供合適的工具來滿足你的需求。 我們期待收到你對商店設定的意見回饋，以便我們之後進行改善。', '{}', 'unactioned', 'woocommerce-admin', '2021-03-17 02:50:01', NULL, 0, 'plain', '', 0, 'info'),
(24, 'wc-admin-insight-first-sale', 'survey', 'en_US', '你知道嗎？', '採用 WooCommerce 技術的商店平均需 31 天完成第一筆銷售。 一切都在進度上！ 這類洞察分析相當實用，對吧？', '{}', 'unactioned', 'woocommerce-admin', '2021-03-17 02:50:01', NULL, 0, 'plain', '', 0, 'info'),
(25, 'wcpay-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with WooCommerce Payments you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', '{}', 'pending', 'woocommerce.com', '2021-03-05 03:05:22', NULL, 0, 'plain', '', 0, 'info'),
(26, 'wcpay-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with WooCommerce Payments and Apple Pay', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', '{}', 'pending', 'woocommerce.com', '2021-03-05 03:05:22', NULL, 0, 'plain', '', 0, 'info'),
(27, 'paypal_ppcp_gtm_2021', 'marketing', 'en_US', 'Offer more options with the new PayPal', 'Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.', '{}', 'pending', 'woocommerce.com', '2021-03-19 04:42:52', NULL, 0, 'plain', '', 0, 'info'),
(28, 'wcpay-apple-pay-is-now-available', 'marketing', 'en_US', 'Apple Pay is now available with WooCommerce Payments!', 'Increase your conversion rate by offering a fast and secure checkout with <a href=\"https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">Apple Pay</a>®. It’s free to get started with <a href=\"https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">WooCommerce Payments</a>.', '{}', 'pending', 'woocommerce.com', '2021-03-19 04:42:52', NULL, 0, 'plain', '', 0, 'info'),
(29, 'storefront-customize', 'info', 'en_US', 'Design your store with Storefront 🎨', 'Visit the Storefront settings page to start setup and customization of your shop.', '{}', 'unactioned', 'storefront', '2021-04-14 03:24:52', NULL, 0, 'plain', '', 0, 'info'),
(30, 'wc-payments-qualitative-feedback', 'info', 'en_US', 'WooCommerce Payments setup - let us know what you think', 'Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.', '{}', 'pending', 'woocommerce.com', '2021-04-08 00:59:48', NULL, 0, 'plain', '', 0, 'info');
